export default function getOverallTotal(data, ret=['device', 'user', 'did']) {
  let overallTotal = 0

  try {
    if (data['display']['nonehighlighted']) {
      ret.forEach((e) => {
        if (data['display'][e]['total'] > overallTotal) overallTotal = data['display'][e]['total']
      })
      
      return [e, overallTotal]
    }
  
    else {
      ret.forEach((e) => {
        if (data['display'][e]['highlighted']) /* pass */ 
        if (data['display'][e]['total'] > overallTotal) overallTotal = data['display'][e]['total']
      })
  
      return [e, overallTotal]
    }
  }
  catch {/*first render*/}
}
